def dna_complement(dna_seq):
    #Return the complement string of a DNA sequence
    dict_complement = {'A':'T', 'C':'G', 'T':'A', 'G':'C'}
    seq_complement = ''.join([dict_complement[nuc] for nuc in dna_seq])
    reverse_seq_complement = seq_complement[::-1]

    return reverse_seq_complement

input = ''

out = dna_complement(input)
print(out)
